import React from "react";

const Package = () => {
  return (
    <div className="border" style={{ height: 200, width: 250, margin: 20 }}>
      <div style={{ backgroundColor: "red", color: "white" }}>
        <h4>STANDARD</h4>
        <h5>1700/Sqft</h5>
      </div>

      <div style={{ textAlign: "left", padding: 10 }}>
        <p>
          Structure – branded and high quality cement, steel, concrete, bricks
        </p>
        <p>Bare shell – W/O Interiors</p>
      </div>
      <button>VIEW MORE</button>
    </div>
  );
};

export default Package;
